css:
atom-text-editor .cursor {
  border-color: yellow;
}
.tree-view {
  font-size: 17px;
}
.tree-view,
.tree-view-root,
atom-panel-container.footer {
  font-family: 'iA Writer Mono S', monospace;
}
.status-bar {
  font-size: 20px;
}
.editor {
  line-height: 1em;
}
atom-text-editor.editor .bracket-colorizer-color0,
atom-text-editor.editor .bracket-colorizer-color2,
atom-text-editor.editor .bracket-colorizer-color4,
atom-text-editor.editor .bracket-colorizer-color6,
atom-text-editor.editor .bracket-colorizer-color8,
atom-text-editor.editor .bracket-colorizer-color10 {
  color: #e0fde0;
}
atom-text-editor.editor .bracket-colorizer-color1,
atom-text-editor.editor .bracket-colorizer-color3,
atom-text-editor.editor .bracket-colorizer-color5,
atom-text-editor.editor .bracket-colorizer-color7,
atom-text-editor.editor .bracket-colorizer-color9 {
  color: #87CEFA;
}
atom-text-editor .line-number {
  color: #e0fde0;
  opacity: 0.8;
}
.line-number.bracket-matcher.bracket-matcher {
  background-color: #000000;
  color: #33FF00;
}
